export function formatData(){
    function checkArea(area,pid) { 
        let tmpArr = find(pid)
        if(tmpArr.length>0){
            area.children = tmpArr
            area.children.forEach((e,i)=>{
                checkArea(e,e.id);
            })
        }
    }
    let area = {}
    checkArea(area,'0_cn')
    return area.children
}
export function formatData2(){
    function checkArea(area,pid) { 
        let tmpArr = find(pid)
        if(tmpArr.length>0){
            area[pid] = {}
            tmpArr.forEach((e,i)=>{
                area[pid][e.id] = e.name;
                checkArea(area,e.id);
            })
        }
    }
    
    let area = {}
    checkArea(area,'0_cn')
    return area
}
function find(pId){
    let data = mp_countryData
    var r=[]; 
    for(var i=0;i<data.length;i++){
        if(data[i]['pId'] == pId){
            r.push(data[i])
        }
    } 
    return r
}